import React from "react";

import classes from "./Movie.module.css";

const Movie = (props) => {
  /* eslint-disable */
  return (
    <span className={classes.parent}>
      <div className={classes.movie}>
        <h2>{props.title}</h2>
        <h3>{props.releaseDate}</h3>
        <p>{props.openingText}</p>
      </div>
    </span>
  );
};

export default Movie;
